}

  color:#ffffff;
  border-color:var(--lang-hover-bg);
}

<script>
(function(){
  function norm(s){
    s = String(s||'').toLowerCase();
    try { s = s.normalize('NFD').replace(/[\u0300-\u036f]/g,''); } catch(e) {}
    s = s.replace(/[^a-z0-9]+/g,' ').replace(/\s+/g,' ').trim();
    return s;
  }
  window.getFixedName = function(raw, lang){
    try{
      var n = norm(raw);
      // Can Pantiquet
      if(n.includes('pantiquet') && (n.includes('centre')||n.includes('centro')||n.includes('civic')||n.includes('civico'))){
        return (lang==='ca') ? "Centre C√≠vic de Can Pantiquet" : "Centro C√≠vico de Can Pantiquet";
      }
      // Can Borrell
      if(n.includes('borrell') && (n.includes('centre')||n.includes('centro')||n.includes('civic')||n.includes('civico'))){
        return (lang==='ca') ? "Centre C√≠vic de Can Borrell" : "Centro C√≠vico de Can Borrell";
      }
      // Hotel La Rep√∫blica
      if(n.startsWith('hotel') && n.includes('republica')){
        return (lang==='ca') ? "Hotel d'entitats La Rep√∫blica" : "Hotel de entidades La Rep√∫blica";
      }
      
      // Riera Seca: solo capitalizaci√≥n correcta en catal√°n
      if(n.includes('riera seca')){
        if(lang==='ca'){
          try{
            // Reemplaza cualquier variante "riera seca" por "Riera Seca" en el nombre original
            return String(raw||'').replace(/riera\s+seca/gi, 'Riera Seca');
          }catch(e){ return (lang==='ca') ? 'Riera Seca' : (raw||''); }
        }
        // En castellano lo dejamos tal cual
        return raw || '';
      }
return raw || '';
    }catch(e){ return raw || ''; }
  };
})();
</script>


<script>
function getFixedName(name){
  try{
    var norm = (s)=>String(s||'').toLowerCase().normalize('NFD').replace(/[\u0300-\u036f]/g,'').replace(/[^a-z0-9]+/g,' ').trim();
    var n = norm(name);
    // Can Pantiquet
    if(n.includes('pantiquet') && (n.includes('centre')||n.includes('centro')||n.includes('civic')||n.includes('civico'))){
      return (typeof lang!=='undefined' && lang==='ca') ? "Centre C√≠vic de Can Pantiquet" : "Centro C√≠vico de Can Pantiquet";
    }
    // Can Borrell
    if(n.includes('borrell') && (n.includes('centre')||n.includes('centro')||n.includes('civic')||n.includes('civico'))){
      return (typeof lang!=='undefined' && lang==='ca') ? "Centre C√≠vic de Can Borrell" : "Centro C√≠vico de Can Borrell";
    }
    // Riera Seca (solo capitalizaci√≥n en CA)
    if(n.includes('riera seca')){
      if(typeof lang!=='undefined' && lang==='ca'){
        return String(name||'').replace(/riera\s+seca/gi,'Riera Seca');
      }
      return name||'';
    }
    // Can Lled√≥
    if(n.includes('can lledo')){
      if(typeof lang!=='undefined' && lang==='ca') return "Centre de Serveis de Can Lled√≥";
      if(typeof lang!=='undefined' && lang==='es') return "Centro de Servicios de Can Lled√≥";
    }
    return name||'';
  }catch(e){ return name||''; }
}

<script id="res-lang-fix">
(function(){
  const TEXT_CA = "del 22 de setembre al 18 d'octubre";
  const TEXT_ES = "del 22 de septiembre al 18 de octubre";
  const RE_CA = /del 22 de setembre al 18 d[‚Äô']octubre/g;
  const RE_ES = /del 22 de septiembre al 18 de octubre/g;

  function lang() {
    // Prefer explicit active pill if present
    const caActive = document.getElementById("lang-ca")?.classList.contains("active");
    const esActive = document.getElementById("lang-es")?.classList.contains("active");
    if (caActive) return "ca";
    if (esActive) return "es";
    // Fallback heuristics by UI labels
    const txt = document.body.innerText || "";
    if (txt.includes("Resultado") || txt.includes("Buscar") || txt.includes("Limpiar")) return "es";
    if (txt.includes("Resultat") || txt.includes("Cerca") || txt.includes("Netejar")) return "ca";
    // Last resort: default to CA
    return "ca";
  }

  function enforce() {
    const res = document.getElementById("res");
    if (!res) return;
    const L = lang();
    let html = res.innerHTML;
    if (L === "es") {
      // Ensure Spanish text, fix any Catalan leftovers
      html = html.replace(RE_CA, TEXT_ES);
      // Also normalize if already Spanish but with different apostrophe marks around
      // (no action needed beyond RE_ES presence)
    } else {
      // Ensure Catalan text, fix any Spanish leftovers
      html = html.replace(RE_ES, TEXT_CA);
    }
    if (html !== res.innerHTML) res.innerHTML = html;
  }

  // Run at DOM ready and after changes
  document.addEventListener("DOMContentLoaded", enforce);
  const mo = new MutationObserver(enforce);
  mo.observe(document.body, {subtree:true, childList:true, characterData:true});

  // Hook common actions that refresh result or switch language
  ["btn", "btnClear"].forEach(id => {
    const el = document.getElementById(id);
    if (el) el.addEventListener("click", () => setTimeout(enforce, 0), {capture:true});
  });
  ["lang-es", "lang-ca"].forEach(id => {
    const el = document.getElementById(id);
    if (el) el.addEventListener("click", () => setTimeout(enforce, 0), {capture:true});
  });
})();
</script>

      if(!s) return "";

      s = s.normalize('NFD').replace(/[\u0300-\u036f]/g,'');
      s = s.replace(/[‚Äô`]/g,"'").replace(/[^a-z0-9'\s]+/g,' ');

      return s;

        var fixed = 'üèõÔ∏è ' + label + ': ' + name + (phase ? (' ' + phase) : '');

<script>
